import { signInWithGooglePopup , createUserDocumentFromAuth, signInWithGoogleRedirect} from "../../utils/furebase.utils"

const SignIn = () => {
    const logGoogleUser = async () => {
        const {user} = await signInWithGooglePopup();
        const userDocRef = await createUserDocumentFromAuth(user)
    }

    const logGoogleUserWithRedirect = async () => {
        const {user} = await signInWithGoogleRedirect();
        const userDocRef = await createUserDocumentFromAuth(user)
    }
    return (
        <div>
        <h1>Sign In</h1>
        <button onClick={logGoogleUser}>Sign In with Google PopUp</button>
        <button onClick={logGoogleUserWithRedirect}>Sign In with Google PopUp with Redirect</button>
        </div>
    )
}

export default SignIn
